import SideNavBar from "../Components/SideNavBar";
import Box from "@mui/material/Box";
import NavBar from "../Components/NavBar";
import Books from "./Books";

import {Route,Routes,BrowserRouter} from "react-router-dom";
import { Avatar, Stack } from "@mui/material";
import i2  from '../image/i2.PNG'
import i3 from '../image/i3.PNG'
import i4  from '../image/i4.PNG'
import i5  from '../image/i5.PNG'
import i6  from '../image/i6.PNG'
import i7  from '../image/i7.PNG'
import i8  from '../image/i8.PNG'
import i9  from '../image/i9.PNG'
import { useState } from "react";

function Author() {
  const [click, setClick] = useState();

  const handleClick = () => {
    
    <BrowserRouter>
    <Routes>
      <Route path='/' exact element = {<Books/>}></Route> 
    </Routes>
    </BrowserRouter>
  }

  return (
    <>
    <NavBar />
    <Box>
      <Box height={30}/>
      <Box sx={{ display: "flex" }}>
        <SideNavBar />

        <Box component="main" sx={{ flexGrow: 1, p: 3 }}>
          <h1>Author</h1>
          <Stack spacing={10} direction="row">
           
           <Avatar src={i2} alt="Pic not found" sx={{bgcolor:"secondary.main", width:160, height:160}} onClick = {handleClick}/>
           <Avatar src={i3} alt="Pic not found" sx={{bgcolor:"secondary.main", width:160, height:160}}/>
           <Avatar src={i4} alt="Pic not found" sx={{bgcolor:"secondary.main", width:160, height:160}}/>
           <Avatar src={i5} alt="Pic not found" sx={{bgcolor:"secondary.main",width:160, height:160}}/>
           
          </Stack>
          <Stack spacing={10} direction="row" sx={{marginTop: 6}}>
           
          <Avatar src={i6} alt="Pic not found" sx={{bgcolor:"secondary.main", width:160, height:160}}/>
           <Avatar src={i7} alt="Pic not found" sx={{bgcolor:"secondary.main", width:160, height:160}}/>
           <Avatar src={i8} alt="Pic not found" sx={{bgcolor:"secondary.main", width:160, height:160}}/>
           <Avatar src={i9} alt="Pic not found" sx={{bgcolor:"secondary.main", width:160, height:160}}/>
          </Stack>
          </Box>
        </Box>
      </Box>
    </>
  );
}
export default Author;
